    <div className="App">
      <header className="App-header">
      <Canvas>
          <Box position={[-1, 0, 0]} />
          <Box position={[1, 0, 0]} />
      </Canvas>
      <p> 
        Edit <code>src/App.js</code> and save to reload.
      </p>
      </header>

    </div>
  );
}

export default App;
